Create DATABASE BelgiumCampusDataBase ;
GO

USE BelgiumCampusDataBase;

GO


CREATE TABLE Modules
(

	ModuleCodes INT PRIMARY KEY,
	ModuleName VARCHAR(50) NOT NULL,
	ModuleDescription VARCHAR(MAX),
	OnlineResource VARCHAR(MAX),

);


GO
 
create table Students (
	StudentNumber INT PRIMARY KEY ,
	Firstname VARCHAR(50) NOT NULL,
	Surname VARCHAR(50) NOT NULL,
	StudentImage VARCHAR(50),
	DOB DATE NOT NULL,
	Gender VARCHAR(50) NOT NULL,
	Phone VARCHAR(50) NOT NULL,
	StudentAddress VARCHAR(50) NOT NULL,
	ModuleCodes INT FOREIGN KEY REFERENCES Modules(ModuleCodes),
);


GO

UPDATE Students
SET StudentImage = 'DefaultProfile.png';